<template>
  <div class="plan" ref="plan">
    <svg
      width="100%"
      height="100%"
      viewBox="0 0 1395 1660"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <template v-for="district in districts" :key="district.id">
        <path
          class="path"
          :d="district.d"
          @mouseout="mouseOut($event)"
          @mousemove="mouseMove($event, district.id)"
          @click="clickDistrict(district.id)"
          :stroke="route.query.district == district.id ? '#ED1556' : false"
          stroke-width="5"
          :fill="
            district.to25
              ? '#8eb4e3'
              : district.to25from50
              ? '#558dd6'
              : district.to50
              ? '#17375e'
              : '#8eb4e3'
          "
          :class="`g${district.id}r`"
        />
